function findAmbiguous() {
    var ambiguousStims = []
    for (var i=0; i<stimuliList.length; i++) {
        if (stimuliList[i].speakerAmbiguous == "True") {
            ambiguousStims = ambiguousStims.concat(stimuliList[i])
        }
    }
    return ambiguousStims
}

function findUnambiguous() {
    var unambiguousStims = []
    for (var i=0; i<stimuliList.length; i++) {
        if (stimuliList[i].speakerAmbiguous == "False") {
            unambiguousStims = unambiguousStims.concat(stimuliList[i])
        }
    }
    return unambiguousStims
}

function makeStims() {
    var ambStims = _.sample(findAmbiguous(),10)
    var unambStims = _.sample(findUnambiguous(),5)

    var stims = ambStims.concat(unambStims)

    return stims;
    
}

